$\text{
Let $f$ be a function.
}$

$\text{
Let $f'$ be the derived function of $f$.
}$

$
\forall a\in(D_{definition}\cap D_{derivability})
$

$\text{
If $f'(a)>0$ then $f$ is ascending.
}$

$\text{
If $f'(a)<0$ then $f$ is descending.
}$

$\text{
If $f'(a)=0$ then $f$ is an extremum only if the variations between the two intervals separated by $a$ have a different variation!
}$
